package com.mock;

public class Practice2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 1;

		while (i <= 5) {

			int j = 1;
			while (j <= i) {

				System.out.print(j);
				System.out.print(" ");
				j++;
			}
			i++;

			System.out.println(" ");
		}

	}

}


